# IconManager.ps1

# Hashtable of Base64-encoded icons
$Global:Icons = @{
    "alert"   = ''
    "battery" = ''
    "checking"= ''
    "monitor" = ''
    "wifi"    = ''
    "ok"      = ''
    "warning" = ''
}

$Global:Images = @{
    "alert"   = ''
    "battery" = ''
    "checking"= ''
    "monitor" = ''
    "ok"      = ''
    "warning" = ''
    "wifi"    = ''
}
function Get-IconFromBase64 {
    param (
        [Parameter(Mandatory)]
        [string]$Base64
    )
    $bytes = [Convert]::FromBase64String($Base64)
    $stream = New-Object IO.MemoryStream($bytes, 0, $bytes.Length)
    $bitmap = New-Object System.Drawing.Bitmap -ArgumentList $stream
    return [System.Drawing.Icon]::FromHandle($bitmap.GetHicon())
}

function Get-ImageFromBase64 {
    param (
        [Parameter(Mandatory)]
        [string]$Base64
    )

    $bytes = [Convert]::FromBase64String($Base64)
    $stream = [System.IO.MemoryStream]::new([byte[]]$bytes)
    return [System.Drawing.Image]::FromStream($stream)
}

function Get-Icon {
    param (
        [Parameter(Mandatory)]
        [ValidateSet("alert", "battery", "checking", "monitor", "wifi", "ok", "warning")]
        [string]$Name
    )
    return Get-IconFromBase64 -Base64 $Global:Icons[$Name]
}